import React from "react";
import {connect} from "react-redux";
import {Jumbotron} from 'reactstrap';

class EmptyDataset extends React.Component {


    render() {
        const {language} = this.props;

        if (language) {
            return (
                <div className={'empty-data'}>
                    <Jumbotron className="empty-data-content">
                        <h1 className="display-5">{language.emptyDataMatrix.title}</h1>
                        <p className="lead">{language.emptyDataMatrix.spot}</p>
                        <hr className="my-2"/>
                        <p>{language.emptyDataMatrix.text}</p>
                    </Jumbotron>
                </div>
            )
        } else {
            return (<></>)
        }
    }
}

function mapStateToProps(state) {
    return {
        language: state.language
    }
}

export default connect(mapStateToProps)(EmptyDataset);
